import {All} from './RemAll';
import { Reimbursement } from '../models/Reimbursement';

interface IAppState {
    // userid:number;
    // single: any;
    levelup: Reimbursement[] | any;
  }

export default class users extends React.Component<IAppState,any> {

constructor(props:any){
    super(props);
    this.state = {
        // userid : 2,
        value: '',
        // single:'' ,
        input: '',
        handleChange : this.handleChange.bind(this),
        handleSubmit : this.handleSubmit.bind(this),
        random: false,
        random1: false,
        random2: false
    }
}
// shouldComponentUpdate(nextProps: any, nextState: any) {
//     return this.state.value !== nextState.value;
//   }

showIn = () => {
    this.setState({
      random: true,
      random1: false,
      random2:false
    })
  }

  showAll = () => {
    this.setState({
      random: false ,
      random1: true,
      random2 :false  
    })
  }

  showUp = () => {
    this.setState({
      random: false ,
      random2: true,
      random1: false   
    })
  }

changevalue = () => {
    this.setState({
      value:  1     
    })
  }


   updateUserxx = (user:Reimbursement) => {
    this.setState({
      levelup: user,
    })
  }

  handleChange = (e:any) => {
    this.setState({input: e.target.value});
    this.setState({random : true, random1:false})
  }

  handleSubmit = (event:any)=> {
    this.setState({value: this.state.input});
    event.preventDefault();
  }

    render(){
        return(
            <>
            <div className="panel">
            <span  onClick={this.showIn}>Individual </span>
            <span  onClick={this.showAll}>All </span>
            <span  onClick={this.showUp}> Update  </span>
            </div>
            <div id ="hideme" className="wrapmein">

          { this.state.random &&   <div className="dif">
                <form onSubmit={this.handleSubmit}>
                <label>Employee ID: </label>
                <input type="text" onChange={this.handleChange} />
                <input type="submit" onClick={this.handleSubmit} value="Fetch" />
                <label>&nbsp;</label>
                </form>
            </div>}

            {/* { this.state.random && <SingleUser userid={this.state.value}/>} */}
            { this.state.random1 && <All />}
            {/* { this.state.random2 && <UpdateUsers u
                pdateUserxx={this.updateUserxx}/>} */}
               </div>          
            </>

        )
    }
}
